import logo from './logo.svg';
import './App.css';
import TextBox from './TextBox'
import React, {useState} from 'react'
import { AwesomeButton } from "react-awesome-button";
import "react-awesome-button/dist/styles.css";

function Route() {
  const [startLat, setStartLat] = useState(0);
  const [startLon, setStartLon] = useState(0);
  const [endLat, setEndLat] = useState(0);
  const [endLon, setEndLon] = useState(0);
  return (
    <div className="Route">
      <header className="Route-header">
        <title>This is a title</title>
      </header>
        <h1>{startLat}</h1>
        <TextBox label={"Start Latitude"} onChange = {(e) => setStartLat(e)}/>
        <TextBox label={"Start Longitude"} onChange = {(e) => setStartLon(e)}/>
        <TextBox label={"End Latitude"} onChange = {(e) => setEndLat(e)}/>
        <TextBox label={"End Longitude"} onChange = {(e) => setEndLon(e)}/>

      <AwesomeButton type="primary">Button</AwesomeButton>
    </div>
  );
}
export default Route;
